Het verhaal gaat over de seriemoordenaar Ed Gein, die de bijnaam kreeg als &quot;The Butcher of Plainfield&quot;. In de jaren vijftig was Ed Gein verantwoordelijk voor een serie bloedige moorden, die een golf van angst en terreur zaaide over heel Wisconsin. We nemen dit keer een kijkje in de ziekelijke geest van de slachter, waarom hij al deze moorden beraamde.

